Git
FAQ

What does push.default &quot;matching&quot; and &quot;simple&quot; mean?在 Git 2.0+ 版本中，本地分支与远端分支未关联，是 push 失败的常见的原因。命令行提示中讲得很清楚：

its implicit value has changed in Git 2.0 from &#39;matching&#39; to &#39;simple&#39;....When push.default is set to &#39;matching&#39;, git will push local branches to the remote branches that already exist with the same name.
Since Git 2.0, Git defaults to the more conservative &#39;simple&#39; behavior, which only pushes the current branch to the corresponding remote branch that &#39;git pull&#39; uses to update the current branch.


Why the files just pulled from remote are &quot;unstaged&quot;?   


