关于加密，你应该知道的“黑话”

盐（salt）“盐”是混淆到消息主文中的佐料，以加强破译难度。

对称经济学中有一个短语叫“信息不对称”，意思你懂的。在加密领域中，以消息的发送方（创建者）和接收方（读取者）为两端，所谓“对称”，是指接收方有能力译解消息以获取消息原文。

不对称根据“对称”的定义，“不对称”是指接收方没有能力译解消息，无法获知消息原文。



